tables.table_schema:
CREATE TABLE raw_data (
    id UUID PRIMARY KEY,
    data JSONB
);

CREATE TABLE preprocessed_data (
    id UUID PRIMARY KEY,
    preprocessed_data JSONB
);

CREATE TABLE training_results (
    id INT PRIMARY KEY,
    model_id INT,
    accuracy DECIMAL(5,2),
    loss DECIMAL(5,2)
);

CREATE TABLE data_preprocessing (
    id INT PRIMARY KEY,
    raw_data TEXT,
    cleaned_data TEXT
);

CREATE TABLE column_metadata (
    id INT PRIMARY KEY,
    column_name VARCHAR(50),
    data_type VARCHAR(50),
    is_nullable BOOLEAN
);

CREATE TABLE preprocessing_logs (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    action_taken TEXT
);

CREATE TABLE ml_model_training (
    id INT PRIMARY KEY,
    model_name VARCHAR(50),
    training_data TEXT,
    model_accuracy FLOAT
);

CREATE TABLE RawData (
    id SERIAL PRIMARY KEY,
    raw_text TEXT,
    data_type TEXT
);

CREATE TABLE CleanedData (
    id SERIAL PRIMARY KEY,
    raw_data_id INT,
    cleaned_text TEXT
);

CREATE TABLE DataPreprocessingLogs (
    id SERIAL PRIMARY KEY,
    raw_data_id INT,
    preprocessing_step TEXT,
    status TEXT
);

CREATE TABLE MLAlgorithmInput (
    id SERIAL PRIMARY KEY,
    cleaned_data_id INT,
    formatted_input TEXT
);

CREATE TABLE MLAlgorithmOutput (
    id SERIAL PRIMARY KEY,
    ml_result_id INT,
    prediction_result TEXT
);
